import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => (
  <div>
    <h1>Welcome to Store Rating App</h1>
    <p><Link to="/login">Login</Link> or <Link to="/signup">Signup</Link></p>
  </div>
);

export default HomePage;
